import axios from 'axios';

const baseUrl = 'https://testgraming.net';
const consumer_key = 'ck_de866a2819316f78ca384e75f2ae9d920ca65cbb';
const consumer_secret = 'cs_fdadbf0561f043d8e0ce537de4fc6a4650ab0740';

const FetchTikTokLikes = async (setTiktoklikes, setIsLoading, setError) => {
  try {
    const response = await axios.get(
      `${baseUrl}/wp-json/wc/v3/products?consumer_key=${consumer_key}&consumer_secret=${consumer_secret}`
    );

    const metaData = response.data
      .filter(product => product.name === 'Buy Instagram Likes')
      .map(product => product.meta_data);

    const quantityOptions = metaData.reduce((acc, item) => {
      const match = item.key.match(
        /quantity_options_(\d+)_(quantity|price|discount)/
      );
      if (match) {
        const [_, index, field] = match;
        if (!acc[index]) {
          acc[index] = {};
        }
        acc[index][field] = item.value;
      }
      return acc;
    }, []);

    console.log(quantityOptions);

    // setTiktoklikes(response.data.results);
    setIsLoading(false);
  } catch (error) {}
};

export default FetchTikTokLikes;
